import styled from 'styled-components'
import useStats from '../utils/useStats'

export default function Stats({ url }) {
  const { stats, loading } = useStats(url)
  console.log(loading)
  if (loading) return <p>Loading...</p>
  return (
    <div>
      {stats}
    </div>
  )
}
